const uint8_t *Imagenes::obtenerImagen(const char *nombre)
{
    if (strcmp(nombre, "iniciar_prueba") == 0)
        return iniciar_prueba;
    if (strcmp(nombre, "agregar_inyector") == 0)
        return agregar_inyector;
    if (strcmp(nombre, "ayuda") == 0)
        return ayuda;
    if (strcmp(nombre, "modo_manual") == 0)
        return modo_manual;
    if (strcmp(nombre, "modo_automatico") == 0)
        return modo_automatico;
    if (strcmp(nombre, "atras") == 0)
        return atras;
    if (strcmp(nombre, "prueba_medir_resistencia") == 0)
        return prueba_medir_resistencia;
    if (strcmp(nombre, "prueba_de_llenado") == 0)
        return prueba_de_llenado;
    if (strcmp(nombre, "prueba_de_goteo") == 0)
        return prueba_de_goteo;
    if (strcmp(nombre, "prueba_medir_clic") == 0)
        return prueba_medir_clic;
    if (strcmp(nombre, "prueba_abanico") == 0)
        return prueba_abanico;
    if (strcmp(nombre, "resultados") == 0)
        return resultados;
    if (strcmp(nombre, "devolver") == 0)
        return devolver;
    if (strcmp(nombre, "VER_CARACT") == 0)
        return VER_CARACT;
    if (strcmp(nombre, "SIGUIENTEFUNCIONAMIENTO") == 0)
        return SIGUIENTEFUNCIONAMIENTO;
    if (strcmp(nombre, "ATRASMENU") == 0)
        return ATRASMENU;
    if (strcmp(nombre, "Atrasinyectores") == 0)
        return Atrasinyectores;
    if (strcmp(nombre, "injagregados") == 0)
        return injagregados;
    if (strcmp(nombre, "injdefecto") == 0)
        return injdefecto;
    if (strcmp(nombre, "agregarborrarinyector") == 0)
        return agregarborrarinyector;
    if (strcmp(nombre, "ATRASAGREGARINYECTOR_INJ") == 0)
        return ATRASAGREGARINYECTOR_INJ;
    if (strcmp(nombre, "BORRAR_INJ") == 0)
        return BORRAR_INJ;
    if (strcmp(nombre, "AGREGAR_INJ") == 0)
        return AGREGAR_INJ;
    return nullptr; // Retorna nullptr si no se encuentra
}
